import React from 'react';
import { MDBCard, MDBCardBody, MDBCardHeader, MDBInput, MDBBtn, MDBTable, MDBTableBody, MDBTableHead  } from 'mdbreact';

const TablePanel = (props) => {
  const data_panel = {
    rows: [
      {
        1: "Chipotle charged Julia Liu",
        2: "Burritos"
      },
      {
        "1": "Unibowl charged Benji",
        "2": "Hot Pot and Boba"
      },
      {
        "1": "Chipotle charged Julia Liu",
        "2": "Burritos"
      }
    ]
  };

  return(

    <MDBCard narrow style={{marginTop:"10px",width:"40%"}}>
      <MDBCardHeader className="view view-cascade gradient-card-header info-color d-flex justify-content-between align-items-center py-3 mx-0 mb-0">

        <div href="#" className="white-text"  style={{display:"inline-block"}}>Transaction History</div>

      </MDBCardHeader>
      <MDBCardBody cascade>
        <MDBTable btn fixed >
          <MDBTableBody rows={data_panel.rows} />
        </MDBTable>
      </MDBCardBody>
    </MDBCard>
  );
};

export default TablePanel;
